import React, {Component} from 'react';
import './product.css';
import Axios from "axios";

class AllProduct extends Component {

    constructor() {
        super();
        this.state={
            products:[]
        }
    }



    componentDidMount() {

        Axios.get("http://localhost:2001/evaly/api/product/")
            .then(res=>{

                this.setState({
                    products:res.data
                })
            })
            .catch(error=>{
                console.log(error)
            })

    }


    render() {
        return (
            <div className="productList">

                    <img src="http://localhost:2001/2020-09-23T05-15-40.160ZCapture.JPG"/>
                    <p className="productname">Product Name</p>
                    <p className="discription">Discription</p>
                      <p className="price">price:</p>
            </div>
        );
    }
}

export default AllProduct;
